    false,nt"url": null,nt"notes": "Shallow-water (<30m) benthic habitat maps
    of the nearshore marine environment of Jobos Bay, Puerto Rico were mapped and characterized
    using visual interpretation of optical and acoustic remotely sensed imagery. The
    objective of this effort, conducted by NOAA's Center for Coastal Monitoring and
    Assessment Biogeography Branch in partnership with NOAA's National Estuarine Research
    Reserve System (NERRS), was to provide spatially-explicit information on the habitat
    types, biological cover and live coral cover of Jobos Bay's coral reef ecosystem.",nt"license_title":
